        /* Стиль шрифта для подписи обычных узлов */
        text {
          font-size: 14.4px;
          font-style: normal;
          font-weight: normal;
          text-anchor: start;
          fill: #000000;
          font-family: sans-serif;
        }

        /* Стиль шрифта для подписи главных узлов */
