          font-size: 9.6px;
        }


        .dash {
          stroke-dasharray: 4;
        }

        .t0 {
          fill: none;
          stroke-width: 3;
        }

        /* Однопутка */
        .t1 {
          fill: none;
          stroke-width: 4.5;
        }

        /* Двухпутка */
