          fill: none;
          stroke-width: 9;
        }

        .t3 {
          fill: none;
          stroke-width: 12;
        }

        /* Автономная тяга с пассажирским движением */
        .aut {
          stroke: #308241;
        }

        /* Автономная тяга без пассажирского движения */
        .aut_nopass {
          stroke: #00ff00;
        }

        /* Переменный ток с пассажирским движением */
        .el_ac {
          stroke: #ff0000;
        }

        /* Переменный ток без пассажирского движения */
        .el_ac_nopass {
          stroke: #f1657d;
        }

        /* Постоянный ток с пассажирским движением */
