          stroke: #ffa500;
        }

        /* Постоянный ток без пассажирского движения */
        .el_dc_nopass {
          stroke: #ffdd00;
        }

        /* 1435 мм, с пассажирским движением */
        .g_1435 {
          stroke: #0000FF;
        }

        /* 1435 мм, без пассажирского движения */
        .g_1435_nopass {
          stroke: #00C0FF;
        }

        /* Узкая колея */
        .narrow_gauge {
          stroke: #a020f0;
        }

        /* Неиспользуемая линия */
        .not_used {
          stroke: #000000;
        }

        /* Разобранная линия */
        .destroyed {
          stroke: #8c8c8c;
        }

        /* Линия других дорог*/
        .oth_rail {
          stroke: #a88080;
        }

        /* Выделение линии при наведении мыши */
        a.text_link:hover {
          opacity: 0.5;
        }

        a:hover {
          cursor: pointer;
        }

        /* Класс для кнопок управления на карте */
        #controls &gt;
        rect,
        #controls &gt;

        line {
          fill: #ffffff;
          stroke: #000000;
          stroke-width: 0.5;
          fill-opacity: 1;
        }

        .text_right {
          text-anchor: end;
        }
      </style>
